import Vue from 'vue'
import Vuex from 'vuex'
import main from './modules/main'
import icon from './modules/icon'

Vue.use(Vuex)
const debug = process.env.NODE_ENV !== 'production';

export default new Vuex.Store({
  modules: {
    main,
    icon
  },
  strict: debug,
})
